import React from 'react';
import 'mdb-react-ui-kit/dist/css/mdb.min.css'

function Videos(props) {
    return (
		<>
      <div>
        <Videos muted autoPlay loop>
          <source src="/videos/CARE_GEP_STACY.mp4" type="video/mp4"/>
        </Videos>
      </div>
		</>
    );
}


export default Videos;
